import React from "react"
// import {nanoid} from "nanoid"
import StartUp from "./Components/StartUp"
import Questions from "./Components/Questions"


export default function App() {
  const [start, setStart] = React.useState(true)

  function startQuiz() {
    setStart(prev =>!prev)
  }

  return (
    <div>
    {
      start === false 
      ?
      <div> 
      <StartUp 
        start={startQuiz()}
      />
      </div>
      :
      <Questions />
    }
    </div>
  )
}
